const Contact = () => {
  return (
    <div className='contact-info'>
      <h1>Contact</h1>
      <h2>Contact Information</h2>
      <p>
        <strong>Email:</strong>{' '}
        <a href='mailto:info.curbAppeal@gmail.com'>
          info.curbAppeals@gmail.com
        </a>
      </p>
      <p>
        <strong>Phone:</strong> (425) 773-2818
      </p>
    </div>
  );
};

export default Contact;
